function deblank(s) {
  var i,posnb;

  posnb = -1;
  for (i=s.length-1; i>=0; i--)
    { 
      if (s.substring(i,i+1) != " ")
        posnb = i;
    }
  if (posnb != -1)
    return(s.substring(posnb,s.length));   
  else
    return(s);
}


function octalfromint(i) {  /*16 bit to be converted to 4 octal dig*/

  var
    d0, /* 8**0 digit*/
    d1, /* 8**1 digit*/
    d2, /* 8**2 digit*/
    d3; /* 8**3 digit*/

    d1 = Math.floor(i / 8) % 8;
    d0 = i % 8;
    return(""+d3+d2+d1+d0);
  }

function chr(x){
  x=x&127;
